def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])
    min_path = []

    def dfs(i, j, path):
        if len(path) == k:
            nonlocal min_path
            if not min_path:
                min_path = path.copy()
            elif path < min_path:
                min_path = path.copy()
            return
        path.append(grid[i][j])
        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            if 0 <= x < n and 0 <= y < m:
                dfs(x, y, path)
        path.pop()

    for i in range(n):
        for j in range(m):
            dfs(i, j, [])

    return min_path

