def prod_signs(arr):
    if not arr:
        return None
    product = 1
    contains_zero = False
    for num in arr:
        if num == 0:
            contains_zero = True
            break
        product *= num / abs(num)
    if contains_zero:
        return 0
    return sum(abs(num) for num in arr) * product

def histogram(test):
    letters = test.split()
    letter_count = {}
    for letter in letters:
        if letter in letter_count:
            letter_count[letter] += 1
        else:
            letter_count[letter] = 1
    if not letter_count:
        return {}
    max_count = max(letter_count.values())
    return {letter: count for letter, count in letter_count.items() if count == max_count}

