            max_index = i
    return max_index

def is_nested(string):
    stack = []
    nested = False
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack:
            stack.pop()
            if len(stack) > 0:
                nested = True
        else:
            return False
    return nested and len(stack) != len(string) // 2

