def compare_one(a, b):
    if type(a) in (int, float) and type(b) in (int, float):
        return a if a > b else b if b > a else None
    elif isinstance(a, str) and ',' in a:
        return a if isinstance(b, str) and ',' not in b else a
    elif isinstance(b, str) and ',' in b:
        return b
    else:
        return a if type(a) == type(b) and a > b else b

def fix_spaces(text):
    result = ""
    count = 0
    for i, char in enumerate(text):
        if char == " ":
            count += 1
            if count > 2 or (i == 0 and count > 0):
                result = result[:-1] + "-"
        else:
            count = 0
        if char != " ":
            result += char
        else:
            result += "_"
    return result

